import React from 'react';

const Range = (props) => (
  <div className="range">
    <span> IMDB Rating: </span>
    <input
      className="form__input slider"
      type="range" min="1" value={this.imdb} max="10"
      onChange={this.handleChange}
      name="imdb"
    />
  </div>
);

export default Range;
